import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import NavBar from './components/NavBar';
import About from './components/About';
import FeedbackLoop from './components/FeedbackLoop';
import ReactCalculator from './components/ReactCalculator';
import ZipCodeCalculator from './components/ZipCodeCalculator';

const App: React.FC = () => {
  return (
    <Router>
      <div>
        <NavBar />
        <Switch>
          <Route path="/about" component={About} />
          <Route path="/feedback-loop" component={FeedbackLoop} />
          <Route path="/react-calculator" component={ReactCalculator} />
          <Route path="/zip-code-calculator" component={ZipCodeCalculator} />
        </Switch>
      </div>
    </Router>
  );
};

export default App;
